import React from "react";
import { Route, Routes } from "react-router-dom";

const BookRoutes = () => {
  return (
    <Routes>
      <Route index element={<Products />} />
      <Route path=":id" element={<ProductsList />}></Route>
      <Route path="new" element={<NewProduct />}></Route>
    </Routes>
  );
};

export default BookRoutes;
